import Admin from './pages/Admin';
import Auth from './pages/Auth';
import Basket from './pages/Basket';
import Registartion from './pages/Registration';
import ServiceInfo from './pages/ServiceInfo';
import Services from './pages/Services';
import { ADMIN_ROUTE, AUTH_ROUTE, BASKET_ROUTE, REGISTRATION_ROUTE, SERVICEINFO_ROUTE, SERVICES_ROUTE } from './utils/constants';

export const authRoutes = [
  {
    path: ADMIN_ROUTE,
    Component: Admin
  },
  {
    path: BASKET_ROUTE,
    Component: Basket
  },
];

export const publicRoutes = [
  {
    path: REGISTRATION_ROUTE,
    Component: Registartion
  },
  {
    path: AUTH_ROUTE,
    Component: Auth
  },
  {
    path: SERVICES_ROUTE,
    Component: Services
  },
  {
    path: SERVICEINFO_ROUTE + '/:id',
    Component: ServiceInfo
  }
]
